import React, { useState, useEffect } from "react";
import axios from "axios";

const YouTube = () => {
  const [channelData, setChannelData] = useState(null);
  const [videos, setVideos] = useState([]);
  const [loading, setLoading] = useState(true);
  const [pageToken, setPageToken] = useState("");
  const [nextPageToken, setNextPageToken] = useState("");
  const [prevPageToken, setPrevPageToken] = useState("");
  const [uploadsPlaylistId, setUploadsPlaylistId] = useState("");

  const API_KEY = "YOUR_YOUTUBE_API_KEY"; // Replace with your YouTube API key
  const CHANNEL_ID = "UCSqX6nd5ITl3b9oFGpDPA"; // Your YouTube Channel ID
  const VIDEOS_PER_PAGE = 12; // Number of videos per page

  // Fetch channel data (includes statistics & uploads playlist ID)
  useEffect(() => {
    const fetchChannelData = async () => {
      try {
        const response = await axios.get(
          `https://www.googleapis.com/youtube/v3/channels?part=snippet,statistics,contentDetails&id=${CHANNEL_ID}&key=${API_KEY}`
        );
        const data = response.data.items[0];
        setChannelData(data);
        setUploadsPlaylistId(data.contentDetails.relatedPlaylists.uploads);
      } catch (error) {
        console.error("Error fetching channel data:", error);
      }
    };
    fetchChannelData();
  }, []);

  // Fetch videos (including Shorts)
  useEffect(() => {
    if (!uploadsPlaylistId) return;

    const fetchVideos = async () => {
      setLoading(true);
      try {
        const videoResponse = await axios.get(
          `https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&playlistId=${uploadsPlaylistId}&maxResults=${VIDEOS_PER_PAGE}&pageToken=${pageToken}&key=${API_KEY}`
        );
        setVideos(videoResponse.data.items);
        setNextPageToken(videoResponse.data.nextPageToken || "");
        setPrevPageToken(videoResponse.data.prevPageToken || "");
        setLoading(false);
      } catch (error) {
        console.error("Error fetching videos:", error);
        setLoading(false);
      }
    };
    fetchVideos();
  }, [uploadsPlaylistId, pageToken]);

  // Handle pagination
  const handleNextPage = () => {
    if (nextPageToken) setPageToken(nextPageToken);
  };

  const handlePrevPage = () => {
    if (prevPageToken) setPageToken(prevPageToken);
    else setPageToken(""); // Reset to the first page
  };

  return (
    <div className="space-y-6 p-6">
      <h1 className="text-3xl font-bold mb-4">YouTube - @chiranjeevikumar1008</h1>

      {/* Channel Info */}
      {channelData && (
        <div className="bg-gray-100 p-6 rounded-lg shadow">
          <h2 className="text-2xl font-semibold">{channelData.snippet.title}</h2>
          <p className="text-gray-700">
            Subscribers: <span className="font-bold">{channelData.statistics.subscriberCount}</span>
          </p>
          <p className="text-gray-700">
            Total Videos: <span className="font-bold">{channelData.statistics.videoCount}</span>
          </p>
          <p className="text-gray-700">
            Total Views: <span className="font-bold">{channelData.statistics.viewCount}</span>
          </p>
          <p className="text-gray-600 text-sm mt-2">{channelData.snippet.description}</p>
          <a
            href="https://youtube.com/@chiranjeevikumar1008"
            target="_blank"
            rel="noopener noreferrer"
            className="text-blue-600 hover:underline mt-2 inline-block"
          >
            Visit Channel
          </a>
        </div>
      )}

      {/* Featured YouTube Short */}
      <div className="bg-gray-200 p-4 rounded-lg shadow">
        <h2 className="text-xl font-semibold mb-2">Featured YouTube Short</h2>
        <div className="flex justify-center">
          <iframe
            src="https://www.youtube.com/embed/KMyZ6kIjc8Y"
            title="YouTube Short"
            className="w-full md:w-80 h-60 rounded-lg"
            allowFullScreen
          />
        </div>
      </div>

      {/* Video List */}
      {loading ? (
        <p className="text-gray-500">Loading videos...</p>
      ) : (
        <>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {videos.length > 0 ? (
              videos.map((video) => (
                <div key={video.snippet.resourceId.videoId} className="space-y-2">
                  <div className="aspect-w-16 aspect-h-9">
                    <iframe
                      src={`https://www.youtube.com/embed/${video.snippet.resourceId.videoId}`}
                      title={video.snippet.title}
                      allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                      allowFullScreen
                      className="w-full h-full rounded-lg"
                    />
                  </div>
                  <p className="text-sm font-medium truncate">{video.snippet.title}</p>
                  <p className="text-xs text-gray-600">
                    Published: {new Date(video.snippet.publishedAt).toLocaleDateString()}
                  </p>
                </div>
              ))
            ) : (
              <p className="text-gray-500">No videos found.</p>
            )}
          </div>

          {/* Pagination Controls */}
          <div className="flex justify-between mt-6">
            <button
              onClick={handlePrevPage}
              disabled={!prevPageToken && pageToken === ""}
              className="px-4 py-2 bg-gray-900 text-white rounded-lg disabled:bg-gray-400 disabled:cursor-not-allowed"
            >
              Previous
            </button>
            <button
              onClick={handleNextPage}
              disabled={!nextPageToken}
              className="px-4 py-2 bg-gray-900 text-white rounded-lg disabled:bg-gray-400 disabled:cursor-not-allowed"
            >
              Next
            </button>
          </div>
        </>
      )}
    </div>
  );
};

export default YouTube;
